import React, {useEffect, useState} from 'react';
import {List, ListItemText, ListItem} from '@material-ui/core'


function Todo({text}) {
    return (
        <List>
            <ListItem>
                <ListItemText primary="Todo" secondary={text}/>
            </ListItem>
        </List>
    )
}

export default Todo
